const Home = () => {
    const onboardingComplete = useSelector(state => state.user.onboardingComplete);
    const dispatch = useDispatch();

    const handleLogout = () => {
        dispatch(logout());
    }

    if (onboardingComplete) {
        return (
            <>  
                <div>
                    <button className="btn btn-secondary float-end" onClick={handleLogout}>
                        Logout
                    </button>
                </div>
                <TodoList/>
                <AddTodo/>
            </>
        )
    } else {
        return (
            <OnboardingSlides/>
        )
    }

    return(
        <p>Sup</p>
    )
}

export default Home
